import React from 'react';
import { motion } from 'framer-motion';

const AnalyticsPage = () => {
    return (
        <div className="p-6 max-w-7xl mx-auto space-y-8">
            <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                className="space-y-4"
            >
                <h1 className="text-4xl font-bold bg-gradient-to-r from-blue-600 to-indigo-600 bg-clip-text text-transparent">
                    Analytics
                </h1>
                <p className="text-gray-500 text-lg">
                    Deep insights into your team's performance and project health.
                </p>
            </motion.div>

            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                {/* Placeholder Charts/Stats */}
                {[1, 2, 3].map((item) => (
                    <div key={item} className="bg-white p-6 rounded-xl shadow-sm border border-gray-100 h-64 flex items-center justify-center">
                        <span className="text-gray-400">Chart Placeholder {item}</span>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default AnalyticsPage;
